import './App.css';
import Login from './components/login/Login';
import User from './components/user/User';

const Users = [
  {
    nombre: "Luz",
    clave:23
  }
]

function App() {
  return (
    <div className="App">
        <Login></Login>
        <User></User>
    </div>
  );
}

export default App;
